import {Text, StyleSheet, View, TextInput} from "react-native";
import React from "react";

const styles = StyleSheet.create(
    {
        container: {
            display: 'flex',
            flexDirection: 'column',
            //backgroundColor: 'lightgrey',
            padding: 16,
        },

        item: {
            fontFamily: 'Roboto',
            fontSize: 18,
            width: 300,
            backgroundColor: 'teal',
            fontWeight: 'bold',
            padding: 8,
        }
    }
)

export default class ReportTemplate extends React.Component {
    constructor(props){
        super(props);
        this.state ={
            title: "Relatório Mensal",
            month: '',
            hours: '',
            munutes: '',
            revisits: '',
            studies: '',
            publications: '',
            videos: ' ',
            remarks: ' '
        };
    }

    render(){
        return <View style={styles.container}>

            <Text style={{fontSize: 24}}>{this.state.title}</Text>
            <Text style={{borderColor: 'black'}} />
            
            <View style={{display: 'flex', flexWrap: 'wrap'}}>
                <Text style={styles.item}>
                    Horas
                </Text>
                <TextInput
                    placeholder="Horas de serviço"
                />
            </View>

            <Text style={styles.item}>
                Minutos
            </Text>
            <TextInput
                placeholder="Minutos de serviço"
            />

            <Text style={styles.item}>
                Revisitas
            </Text>
            <TextInput
                placeholder="Número de revisitas"
            />

            <Text style={styles.item}>
                Estudos
            </Text>
            <TextInput
                placeholder="Número de estudos"
            />
        </View>
    }
}
